(142, 1, '2020-06-10 01:59:51', '2020-06-09 23:59:51', 'Today we will introduce the updates obtained by the 2021 Volkswagen Arteon, which was officially announced online by the German Volkswagen.\r\n\r\nBut before that, we would like to remind you that our colleague Karim Deeb had previously test-driven the <a href=\"https://www.youtube.com/watch?v=9K56s61fjIA\" target=\"_blank\" rel=\"noopener\"><strong>Arteon before this facelift</strong></a>, and he told you that this German car came to replace  Volkswagen CC, and was launched for the first time in the world at the Geneva Motor Show in 2017.\r\n\r\nThe front of the VW was slightly modified and it got the company’s new logo, with a new continuous light strip connecting the headlights. Additional changes are limited and include striking chrome bars and new air intakes at the bottom, and there is a new rear air diffuser.', 'S- 2021 Volkswagen Arteon', '<strong>Mechanical Specifications of the 2021 Arteon:</strong>\r\n\r\nA turbocharged 2-liter 4-cylinder engine generating 268 hp (272 PS) and 349 Nm of torque.\r\n\r\nAs for the Volkswagen Arteon R Line, its beating heart generates 316 hp (320 PS).\r\n\r\nThe beating heart in this German car is connected to an 8-speed automatic gearbox. It comes standard with a front-wheel-drive system and can be ordered with a 4-wheel all-wheel-drive system.\r\n\r\nThe newest of 2021 Volkswagen cars is also available in a hybrid version that combines t a gasoline engine with and an electric motor that can be recharged by an electric plug  (plug-in hybrid). Both engines generate 215 hp (218 PS).\r\n\r\nThe 2021 Arteon will hit the market in November, and the price of the new Arteon is likely to start from $ 37,015, equivalent to SAR 138,806.', 'publish', 'open', 'closed', '', 's-2021-volkswagen-arteon', '', '', '2021-06-10 11:46:24', '2021-06-10 09:46:24', '', 0, 'http://localhost/wordpress_e_commerce/?post_type=product&#038;p=142', 0, 'product', '', 0),
(146, 1, '2020-06-10 02:11:01', '2020-06-10 00:11:01', 'A few hours ago, the web saw the publication of the first official photos of the new facelifted BMW M5, with its more powerful version, the 2021 BMW M5 Competition.\r\n\r\nIn general, the external changes were slight, as the car got a slightly larger grille, with a newly designed bumper, the car also got new headlights, with L-shaped, LED lamps, and from the sides we see 19-inch rims, which can be replaced optionally with 20-inch rims.\r\n\r\nFrom the back, the newest of BMW M Power cars came with a new bumper and air diffuser and was equipped with 4 exhaust-tips.', 'S- 2021 BMW M5 Competition', 'Inside, the cabin came with a 12.3-inch digital dashboard and a second touch screen of the same size for the iDrive 7 infotainment system. The car supports Apple Car Play and Android Auto applications, and it also provides a wireless charging feature for smartphones, in addition to the latest driving assistance systems.\r\n\r\nMechanically, the 2021 BMW M5 is powered by a twin-turbo 4.4-liter V8 engine that generates 592 hp and 750 Nm. The engine is connected to an 8-speed automatic transmission, and the car can accelerate from 0 to 100 km / h in 3.4 seconds.', 'publish', 'open', 'closed', '', 's-2021-bmw-m5-competition', '', '', '2021-06-10 11:38:47', '2021-06-10 09:38:47', '', 0, 'http://localhost/wordpress_e_commerce/?post_type=product&#038;p=146', 0, 'product', '', 0),
(150, 1, '2020-06-10 02:22:17', '2020-06-10 00:22:17', '2018 Mercedes-Benz  S450 price starts from 412,368 SAR ($109,950)\r\n\r\n2018 Mercedes-Benz  S560 price starts from  501,477 SAR ($133,700)\r\n\r\n2018 Mercedes-Benz S560 4Matic starts from 515,109 SAR ($137,350 )', 'S- 2018 Mercedes-Benz S-Class', 'Cylinders : 8\r\n\r\nTop Speed : 250 km', 'publish', 'open', 'closed', '', 's-2018-mercedes-benz-s-class', '', '', '2021-06-10 11:07:00', '2021-06-10 09:07:00', '', 0, 'http://localhost/wordpress_e_commerce/?post_type=product&#038;p=150', 0, 'product', '', 0),
(153, 1, '2020-06-10 02:50:11', '2020-06-10 00:50:11', 'Sans surprise, cette nouvelle génération du SUV coupé reprend les attributs esthétiques de la version standard et se modernise surtout largement par rapport à la précédente mouture. Nous découvrons donc ici une nouvelle calandre à barres verticales spécifique à la <strong>version AMG</strong>, surmontant un bouclier plus agressif se parant d’une touche de chrome, perçé de deux larges prises d’air noires. Un kit aérodynamique comprenant entre autres des jupes latérales et des boucliers arrière spécifiques fait également partie de la dotation de cette nouvelle génération, tandis que le diffuseur noir intègre quant à lui deux sorties d’échappement rectangulaires. Enfin, un pack <strong>AMG Night Package</strong> permet de profiter de vitres teintées ainsi que de détails peints en noir, tels que les coques de rétroviseurs, l’échappement ou encore les entourages de vitres.<span class=\"Apple-converted-space\"> </span>', 'V- Mercedes-AMG GLE 63 4MATIC+ Coupé', 'AMG Speedshift TCT 9G, associée à la transmission intégrale 4Matic +. Au total, pas moins de 7 modes de conduite sont proposés via le système Dynamic Select, agissant sur la suspension pneumatique de série, la direction, la boîte ainsi que la réactivité du moteur. A noter que la hauteur de caisse s’abaisse et se rehausse selon la configuration choisie et surtout la vitesse. Enfin, le dynamisme et la tenue de route est quant à lui assuré par la présence d’un différentiel électronique placé sur l’essieu arrière.', 'publish', 'open', 'closed', '', 'v-mercedes-amg-gle-6364mati-c-coupe', '', '', '2021-06-10 16:53:54', '2021-06-10 14:53:54', '', 0, 'http://localhost/wordpress_e_commerce/?post_type=product&#038;p=153', 0, 'product', '', 0),
(158, 1, '2020-06-10 03:01:58', '2020-06-10 01:01:58', 'Today, we will show you some digital renderings that imagine what the facelifted 2022 BMW X7 would look like, after we showed you our first test-drive of the new generation of its rival, the <strong>2021 Cadillac Escalade</strong>, which was conducted by our colleague Mousub Shashaa.', 'S- BMW X7', 'These digital images show what the Bavarian BMW X7 would look like after its first generation gets a facelift , and it is expected that the actual facelifted version  of this model would be unveiled next year as a model for the year 2022, God willing.', 'publish', 'open', 'closed', '', 's-bmw-x7', '', '', '2021-06-10 06:30:56', '2021-06-10 04:30:56', '', 0, 'http://localhost/wordpress_e_commerce/?post_type=product&#038;p=158', 0, 'product', '', 0),
