(266, 1, '2021-06-10 11:38:05', '2021-06-10 09:38:05', 'A few hours ago, the web saw the publication of the first official photos of the new facelifted BMW M5, with its more powerful version, the 2021 BMW M5 Competition.\n\nIn general, the external changes were slight, as the car got a slightly larger grille, with a newly designed bumper, the car also got new headlights, with L-shaped, LED lamps, and from the sides we see 19-inch rims, which can be replaced optionally with 20-inch rims.\n\nFrom the back, the newest of BMW M Power cars came with a new bumper and air diffuser and was equipped with 4 exhaust-tips.', 'S- 2021 BMW M5 Competition', 'DETAILS AND COMPOSITTION\n\n-Single-breasted, 2button, patch pockets, breast welt pocket, insid back yoke in lining, inside pockets and small triangle in lining, kissing button on the ciffs\n\n-Unlined\n\n-Made in italy\n\n-87% Wool -8% Silk -5% Linen', 'inherit', 'closed', 'closed', '', '146-autosave-v1', '', '', '2021-06-10 11:38:05', '2021-06-10 09:38:05', '', 146, 'http://localhost/wordpress_e_commerce/?p=266', 0, 'revision', '', 0),
