(326, 1, '2021-06-10 16:08:22', '2021-06-10 14:08:22', '<div class=\"pb-2\">\r\n\r\na Ford Focus tire sa révérence, du moins sur le papier car il faudra attendre quelques mois encore pour voir circuler sa nouvelle génération dans nos rues. Cette troisième génération, que j’avais découverte il y a ce qui me semble être une éternité au <a href=\"https://www.viinz.com/automobile/introducing-the-new-ford-focus-en-hd-enfin/\" target=\"_blank\" rel=\"noopener\">Mondial de Paris 2010</a>, va donc disparaître au profit d’une petite nouvelle, revue en profondeur et disponible dès sa sortie dans de multiples versions mais pas encore dans ses déclinaisons les plus délurées.\r\n\r\n</div>', 'V- Ford Focus RS', '<div class=\"pb-2\">La Focus RS se dote pour ses ultimes tours de roue d’une déclinaison “Pack Performance”, destinée à corriger quelques “failles” (un grand mot) et accroître encore le niveau de performance délirant de sa version d’origine. Surtout, le modèle disponible à l’essai se dotait de la fameuse couleur “Blue Nitrous” qui me faisait diablement envie !</div>', 'publish', 'open', 'closed', '', 'v-ford-focus-rs', '', '', '2021-06-10 17:18:23', '2021-06-10 15:18:23', '', 0, 'http://localhost/wordpress_e_commerce/?post_type=product&#038;p=326', 0, 'product', '', 0),
