(332, 1, '2021-06-10 16:51:36', '2021-06-10 14:51:36', 'Sans surprise, cette nouvelle génération du SUV coupé reprend les attributs esthétiques de la version standard et se modernise surtout largement par rapport à la précédente mouture. Nous découvrons donc ici une nouvelle calandre à barres verticales spécifique à la <strong>version AMG</strong>, surmontant un bouclier plus agressif se parant d’une touche de chrome, perçé de deux larges prises d’air noires. Un kit aérodynamique comprenant entre autres des jupes latérales et des boucliers arrière spécifiques fait également partie de la dotation de cette nouvelle génération, tandis que le diffuseur noir intègre quant à lui deux sorties d’échappement rectangulaires. Enfin, un pack <strong>AMG Night Package</strong> permet de profiter de vitres teintées ainsi que de détails peints en noir, tels que les coques de rétroviseurs, l’échappement ou encore les entourages de vitres.<span class=\"Apple-converted-space\"> </span>', 'V- Mercedes-AMG GLE 63 4MATIC+ Coupé', 'DETAILS AND COMPOSITTION\n\n-Single-breasted, 2button, patch pockets, breast welt pocket, insid back yoke in lining, inside pockets and small triangle in lining, kissing button on the ciffs\n\n-Unlined\n\n-Made in italy\n\n-87% Wool -8% Silk -5% Linen', 'inherit', 'closed', 'closed', '', '153-autosave-v1', '', '', '2021-06-10 16:51:36', '2021-06-10 14:51:36', '', 153, 'http://localhost/wordpress_e_commerce/?p=332', 0, 'revision', '', 0),
