(350, 1, '2021-06-10 17:35:52', '2021-06-10 15:35:52', 'L’AMG GT R Pro ne sera plus le sommet de gamme du modèle, cette place va maintenant être occupée par la Black Series. Avec ce nom, disparu depuis la fin de la SLS, Mercedes annonce la version ultime de sa sportive avant qu’elle ne cède la place à une toute nouvelle génération en 2022. Une variante qui se radicalise sur tous les fronts, à commencer par une carrosserie plus expressive que jamais, inspirée de la variante de compétition AMG GT3.', 'S- AMG GT Black Series', '<h2 id=\"hl_un-v8-porte-a-730-ch\">Un V8 porté à 730 ch</h2>\r\nSous le long capot avant, les ingénieurs AMG ont tout repensé pour des performances accrues, à commencer par <strong>le V8 4.0 litres biturbo poussé à 730 ch et 800 Nm de couple.</strong> Jusqu’ici, la <a title=\"Restylage très discret pour la Mercedes-AMG GT\" href=\"https://www.automobile-magazine.fr/toute-l-actualite/article/24686-restylage-tres-discret-pour-la-mercedes-amg-gt\">GT R Pro</a> culminait à 585 ch et 700 Nm, le gain est donc colossal, grâce notamment à l\'adoption d\'un vilebrequin plat favorable aux hauts régimes. <strong>De quoi venir taquiner la <a title=\"Notre essai de la Ferrari F8 Tributo : la magie continue\" href=\"https://www.automobile-magazine.fr/tous-les-essais/article/26322-notre-essai-de-la-ferrari-f8-tributo-la-magie-continue\">Ferrari F8 Tributo</a> et ses 720 ch.</strong> Le plus puissant des V8 de la marque, toujours associé à la boite automatique à double embrayage Speedeshift à 7 rapports, permettrait à l’auto d’effectuer le <strong>0 à 100 km/h en seulement 3.2 s.</strong>', 'publish', 'open', 'closed', '', 's-amg-gt-black-series', '', '', '2021-06-10 17:45:39', '2021-06-10 15:45:39', '', 0, 'http://localhost/wordpress_e_commerce/?post_type=product&#038;p=350', 0, 'product', '', 0),
