(390, 1, '2021-06-10 17:54:21', '2021-06-10 15:54:21', 'La division mexicaine de Mazda avait vendu la mèche la semaine dernière, mais c’est maintenant officiel : le séduisant CX-30 ajoute un moteur turbo à sa gamme, et ce, dès l’année-modèle 2021.', 'S- MAZDA CX-30', 'Suivant l’exemple de la Mazda3 avec laquelle il partage sa plateforme et ses motorisations, dont des quatre cylindres atmosphériques de 2,0 litres (155 chevaux) et 2,5 litres (186 chevaux), le nouveau multisegment sous-compact sera disponible lui aussi avec un Skyactiv-G turbocompressé de 2,5 litres.', 'publish', 'open', 'closed', '', 's-mazda-cx-30', '', '', '2021-06-10 17:57:30', '2021-06-10 15:57:30', '', 0, 'http://localhost/wordpress_e_commerce/?post_type=product&#038;p=390', 0, 'product', '', 0),
