INSERT INTO `wp_wc_admin_notes` (`note_id`, `name`, `type`, `locale`, `title`, `content`, `icon`, `content_data`, `status`, `source`, `date_created`, `date_reminder`, `is_snoozable`, `layout`, `image`, `is_deleted`) VALUES
(1, 'wc-admin-onboarding-email-marketing', 'info', 'en_US', 'Tips, product updates, and inspiration', 'We\'re here for you - get tips, product updates and inspiration straight to your email box', 'mail', '{}', 'unactioned', 'woocommerce-admin', '2020-06-08 16:05:52', NULL, 0, '', NULL, 0),
(2, 'wc-admin-marketing-intro', 'info', 'en_US', 'Connect with your audience', 'Grow your customer base and increase your sales with marketing tools built for WooCommerce.', 'speaker', '{}', 'unactioned', 'woocommerce-admin', '2020-06-08 16:05:52', NULL, 0, '', NULL, 0),
(3, 'wc-admin-wc-helper-connection', 'info', 'en_US', 'Connect to WooCommerce.com', 'Connect to get important product notifications and updates.', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-06-08 16:05:54', NULL, 0, '', NULL, 0),
(4, 'wc-admin-orders-milestone', 'info', 'en_US', 'Première commande', 'Bravo, vous avez obtenu votre première commande d\'un client ! Découvrez comment gérer vos commandes.', 'trophy', '{}', 'unactioned', 'woocommerce-admin', '2020-06-10 06:19:52', NULL, 0, '', NULL, 0),
(5, 'wc-admin-mobile-app', 'info', 'en_US', 'Installer l\'application mobile Woo', 'Installez l\'application mobile WooCommerce pour gérer les commandes, recevoir des notifications de vente et afficher les statistiques principales où que vous soyez.', 'phone', '{}', 'unactioned', 'woocommerce-admin', '2021-06-10 02:48:59', NULL, 0, '', NULL, 0),
(6, 'wc-admin-usage-tracking-opt-in', 'info', 'en_US', 'Aider WooCommerce à améliorer ses services grâce au suivi de l\'utilisation', 'Récupérer les données d\'utilisation nous permet d\'améliorer WooCommerce. Votre boutique sera prise en compte lors de l\'évaluation des nouvelles fonctionnalités et de la qualité d\'une mise à jour, ou pour déterminer l\'intérêt d\'une amélioration. Vous pouvez toujours consulter les <a href=\"http://localhost/wordpress_e_commerce/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Paramètres</a> et choisir d\'interrompre le partage des données. <a href=\"https://woocommerce.com/usage-tracking\" target=\"_blank\">En savoir plus</a> sur les données que nous collectons.', 'info', '{}', 'unactioned', 'woocommerce-admin', '2021-06-10 02:48:59', NULL, 0, '', NULL, 0),
(7, 'wc-admin-woocommerce-payments', 'info', 'en_US', 'Découvrez la nouvelle façon de se faire payer', 'Acceptez en toute sécurité les cartes de crédit et de débit sur votre site. Gérez vos transactions sans quitter votre tableau de bord WordPress. Uniquement avec WooCommerce Payments.', 'credit-card', '{}', 'unactioned', 'woocommerce-admin', '2021-06-10 02:48:59', NULL, 0, '', NULL, 0),
(8, 'paypal_ppcp_gtm_2021', 'marketing', 'en_US', 'Offer more options with the new PayPal', 'Get the latest PayPal extension for a full suite of payment methods with extensive currency and country coverage.', 'info', '{}', 'pending', 'woocommerce.com', '2021-06-07 19:15:33', NULL, 0, 'plain', '', 0),
(9, 'facebook_pixel_api_2021', 'marketing', 'en_US', 'Improve the performance of your Facebook ads', 'Enable Facebook Pixel and Conversions API through the latest version of Facebook for WooCommerce for improved measurement and ad targeting capabilities.', 'info', '{}', 'pending', 'woocommerce.com', '2021-06-07 19:15:33', NULL, 0, 'plain', '', 0),
(10, 'facebook_ec_2021', 'marketing', 'en_US', 'Sync your product catalog with Facebook to help boost sales', 'A single click adds all products to your Facebook Business Page shop. Product changes are automatically synced, with the flexibility to control which products are listed.', 'info', '{}', 'pending', 'woocommerce.com', '2021-06-07 19:15:33', NULL, 0, 'plain', '', 0),
(11, 'ecomm-need-help-setting-up-your-store', 'info', 'en_US', 'Need help setting up your Store?', 'Schedule a free 30-min <a href=\"https://wordpress.com/support/concierge-support/\">quick start session</a> and get help from our specialists. We’re happy to walk through setup steps, show you around the WordPress.com dashboard, troubleshoot any issues you may have, and help you the find the features you need to accomplish your goals for your site.', 'info', '{}', 'pending', 'woocommerce.com', '2021-06-07 19:15:33', NULL, 0, 'plain', '', 0),
(12, 'woocommerce-services', 'info', 'en_US', 'WooCommerce Shipping & Tax', 'WooCommerce Shipping &amp; Tax helps get your store “ready to sell” as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.', 'info', '{}', 'pending', 'woocommerce.com', '2021-06-07 19:15:33', NULL, 0, 'plain', '', 0),
(13, 'ecomm-unique-shopping-experience', 'info', 'en_US', 'For a shopping experience as unique as your customers', 'Product Add-Ons allow your customers to personalize products while they’re shopping on your online store. No more follow-up email requests—customers get what they want, before they’re done checking out. Learn more about this extension that comes included in your plan.', 'info', '{}', 'pending', 'woocommerce.com', '2021-06-07 19:15:33', NULL, 0, 'plain', '', 0),
(14, 'wc-admin-getting-started-in-ecommerce', 'info', 'en_US', 'Getting Started in eCommerce - webinar', 'We want to make eCommerce and this process of getting started as easy as possible for you. Watch this webinar to get tips on how to have our store up and running in a breeze.', 'info', '{}', 'pending', 'woocommerce.com', '2021-06-07 19:15:33', NULL, 0, 'plain', '', 0),
(15, 'your-first-product', 'info', 'en_US', 'Your first product', 'That\'s huge! You\'re well on your way to building a successful online store — now it’s time to think about how you\'ll fulfill your orders.<br /><br />Read our shipping guide to learn best practices and options for putting together your shipping strategy. And for WooCommerce stores in the United States, you can print discounted shipping labels via USPS with <a href=\"https://href.li/?https://woocommerce.com/shipping\" target=\"_blank\">WooCommerce Shipping</a>.', 'info', '{}', 'pending', 'woocommerce.com', '2021-06-07 19:15:33', NULL, 0, 'plain', '', 0),
(16, 'wc-square-apple-pay-boost-sales', 'marketing', 'en_US', 'Boost sales with Apple Pay', 'Now that you accept Apple Pay® with Square you can increase conversion rates by letting your customers know that Apple Pay® is available. Here’s a marketing guide to help you get started.', 'info', '{}', 'pending', 'woocommerce.com', '2021-06-07 19:15:33', NULL, 0, 'plain', '', 0),
(17, 'wc-square-apple-pay-grow-your-business', 'marketing', 'en_US', 'Grow your business with Square and Apple Pay ', 'Now more than ever, shoppers want a fast, simple, and secure online checkout experience. Increase conversion rates by letting your customers know that you now accept Apple Pay®.', 'info', '{}', 'pending', 'woocommerce.com', '2021-06-07 19:15:33', NULL, 0, 'plain', '', 0),
(18, 'wcpay-apple-pay-is-now-available', 'marketing', 'en_US', 'Apple Pay is now available with WooCommerce Payments!', 'Increase your conversion rate by offering a fast and secure checkout with <a href=\"https://woocommerce.com/apple-pay/?utm_source=inbox&amp;utm_medium=product&amp;utm_campaign=wcpay_applepay\" target=\"_blank\">Apple Pay</a>®. It’s free to get started with <a href=\"https://woocommerce.com/payments/?utm_source=inbox&amp;utm_medium=product&amp;utm_campaign=wcpay_applepay\" target=\"_blank\">WooCommerce Payments</a>.', 'info', '{}', 'pending', 'woocommerce.com', '2021-06-07 19:15:33', NULL, 0, 'plain', '', 0),
(19, 'wcpay-apple-pay-boost-sales', 'marketing', 'en_US', 'Boost sales with Apple Pay', 'Now that you accept Apple Pay® with WooCommerce Payments you can increase conversion rates by letting your customers know that Apple Pay® is available. Here’s a marketing guide to help you get started.', 'info', '{}', 'pending', 'woocommerce.com', '2021-06-07 19:15:33', NULL, 0, 'plain', '', 0),
(20, 'wcpay-apple-pay-grow-your-business', 'marketing', 'en_US', 'Grow your business with WooCommerce Payments and Apple Pay', 'Now more than ever, shoppers want a fast, simple, and secure online checkout experience. Increase conversion rates by letting your customers know that you now accept Apple Pay®.', 'info', '{}', 'pending', 'woocommerce.com', '2021-06-07 19:15:33', NULL, 0, 'plain', '', 0),
(21, 'wc-admin-optimizing-the-checkout-flow', 'info', 'en_US', 'Optimizing the checkout flow', 'It\'s crucial to get your store\'s checkout as smooth as possible to avoid losing sales. Let\'s take a look at how you can optimize the checkout experience for your shoppers.', 'info', '{}', 'pending', 'woocommerce.com', '2021-06-07 19:15:33', NULL, 0, 'plain', '', 0),
(22, 'wc-admin-first-five-things-to-customize', 'info', 'en_US', 'The first 5 things to customize in your store', 'Deciding what to start with first is tricky. To help you properly prioritize, we\'ve put together this short list of the first few things you should customize in WooCommerce.', 'info', '{}', 'pending', 'woocommerce.com', '2021-06-07 19:15:33', NULL, 0, 'plain', '', 0),
(23, 'wc-payments-qualitative-feedback', 'info', 'en_US', 'WooCommerce Payments setup - let us know what you think', 'Congrats on enabling WooCommerce Payments for your store. Please share your feedback in this 2 minute survey to help us improve the setup process.', 'info', '{}', 'pending', 'woocommerce.com', '2021-06-07 19:15:33', NULL, 0, 'plain', '', 0),
(24, 'share-your-feedback-on-paypal', 'info', 'en_US', 'Share your feedback on PayPal', 'Share your feedback in this 2 minute survey about how we can make the process of accepting payments more useful for your store.', 'info', '{}', 'pending', 'woocommerce.com', '2021-06-07 19:15:33', NULL, 0, 'plain', '', 0),
(25, 'wcpay_instant_deposits_gtm_2021', 'marketing', 'en_US', 'Get paid within minutes – Instant Deposits for WooCommerce Payments', 'Stay flexible with immediate access to your funds when you need them – including nights, weekends, and holidays. With <a href=\"https://woocommerce.com/products/woocommerce-payments/?utm_source=inbox&amp;utm_medium=product&amp;utm_campaign=wcpay_instant_deposits\">WooCommerce Payments\'</a> new Instant Deposits feature, you’re able to transfer your earnings to a debit card within minutes.', 'info', '{}', 'pending', 'woocommerce.com', '2021-06-07 19:15:33', NULL, 0, 'plain', '', 0),
(26, 'google_listings_and_ads_install', 'marketing', 'en_US', 'Drive traffic and sales with Google', 'Reach online shoppers to drive traffic and sales for your store by showcasing products across Google, for free or with ads.', 'info', '{}', 'pending', 'woocommerce.com', '2021-06-07 19:15:33', NULL, 0, 'plain', '', 0),
(27, 'wc-subscriptions-security-update-3-0-15', 'info', 'en_US', 'WooCommerce Subscriptions security update!', 'We recently released an important security update to WooCommerce Subscriptions. To ensure your site\'s data is protected, please upgrade <strong>WooCommerce Subscriptions to version 3.0.15</strong> or later.<br /><br />Click the button below to view and update to the latest Subscriptions version, or log in to <a href=\"https://woocommerce.com/my-dashboard\">WooCommerce.com Dashboard</a> and navigate to your <strong>Downloads</strong> page.<br /><br />We recommend always using the latest version of WooCommerce Subscriptions, and other software running on your site, to ensure maximum security.<br /><br />If you have any questions we are here to help — just <a href=\"https://woocommerce.com/my-account/create-a-ticket/\">open a ticket</a>.', 'info', '{}', 'pending', 'woocommerce.com', '2021-06-07 19:15:33', NULL, 0, 'plain', '', 0),
(28, 'wc-update-db-reminder', 'update', 'en_US', 'Mise à jour de base de données WooCommerce obligatoire', 'WooCommerce a été mis à jour ! Pour garder un fonctionnement fluide, nous devons mettre à jour la base de données à la dernière version. Le traitement de la mise à jour se fait en arrière-plan et peut prendre un peu de temps, soyez patients. Sinon, les utilisateurs avancées peuvent mettre à jour via <a href=\"https://github.com/woocommerce/woocommerce/wiki/Upgrading-the-database-using-WP-CLI\">WP CLI</a>.', 'info', '{}', 'unactioned', 'woocommerce-core', '2021-05-23 13:16:17', NULL, 0, 'plain', '', 0),
(29, 'wc-admin-learn-more-about-variable-products', 'info', 'en_US', 'En savoir plus sur les produits variables', 'Les produits variables sont un type de produit puissant qui vous permet de proposer un ensemble de variantes d’un produit avec contrôle des prix, du stock, de l’image et plus pour chaque variante. Vous pouvez l’appliquer à un produit comme une chemise, disponible en plusieurs tailles et dans différentes couleurs.', 'info', '{}', 'unactioned', 'woocommerce-admin', '2021-06-10 09:17:39', NULL, 0, 'plain', '', 0),
(30, 'wc-admin-store-notice-giving-feedback-2', 'info', 'en_US', 'Nous vous invitons à partager votre expérience', 'Maintenant que vous nous avez choisis comme partenaire, notre objectif est de nous assurer que nous vous fournissons les bons outils pour répondre à vos besoins. Nous sommes impatients de recevoir vos commentaires sur votre expérience de conception de la boutique pour que nous puissions l’améliorer à l’avenir.', 'info', '{}', 'unactioned', 'woocommerce-admin', '2021-06-10 16:05:52', NULL, 0, 'plain', '', 0),
(31, 'wc-admin-insight-first-sale', 'survey', 'en_US', 'Le saviez-vous ?', 'Une boutique optimisée par WooCommerce nécessite en moyenne 31 jours pour réaliser sa première vente. Vous êtes sur la bonne voie ! Trouvez-vous ce type d’information utile ?', 'info', '{}', 'unactioned', 'woocommerce-admin', '2021-06-10 16:05:52', NULL, 0, 'plain', '', 0),
(32, 'wc-admin-real-time-order-alerts', 'info', 'en_US', 'Obtenir des alertes de commande en temps réel n’importe où', 'Obtenez des notifications sur l’activité de votre boutique, notamment des nouvelles commandes et des avis sur vos produits, directement sur vos appareils mobiles grâce à l’application Woo.', 'info', '{}', 'unactioned', 'woocommerce-admin', '2021-06-10 16:05:52', NULL, 0, 'plain', '', 0),
(33, 'wc-admin-edit-products-on-the-move', 'info', 'en_US', 'Modifier les produits en étant mobile', 'Modifier et créer des nouveaux produits depuis votre application mobile avec l’application WooCommerce', 'info', '{}', 'unactioned', 'woocommerce-admin', '2021-06-10 16:05:52', NULL, 0, 'plain', '', 0),
(34, 'wc-admin-performance-on-mobile', 'info', 'en_US', 'Suivre les performances de votre boutique sur mobile', 'Suivez vos ventes et performances de vos produits avec l’application Woo.', 'info', '{}', 'unactioned', 'woocommerce-admin', '2021-06-10 16:05:52', NULL, 0, 'plain', '', 0),
(35, 'wc-admin-manage-orders-on-the-go', 'info', 'en_US', 'Gérez vos commandes à la volée', 'Recherchez des commandes et des informations sur les clients, et effectuez des remboursements en un clic à l’aide de l’application Woo.', 'info', '{}', 'unactioned', 'woocommerce-admin', '2021-06-10 16:05:52', NULL, 0, 'plain', '', 0),
(36, 'wc-admin-insight-first-product-and-payment', 'survey', 'en_US', 'Tendances', 'Plus de 80 % des nouveaux commerçants ajoutent leur premier produit et configurent au moins un moyen de paiement durant la première semaine.<br><br>Trouvez-vous ce type d\'information utile ?', 'info', '{}', 'unactioned', 'woocommerce-admin', '2021-06-10 16:05:52', NULL, 0, 'plain', '', 0);
